def keyBoard(word):
    for w in word:
        if not (w.isdigit() or w.isalpha() or isSymbol(w)):
            return False
    return True

def isSymbol(c):
    return (c in "!~@#$%^&*()_+?><.,;:'{}[]=-|\/ ") or (c=='"')

def isShifted(c):
    if c.isalpha():
        return c.isupper()
    return False

def unShiftLetter(c):
    if c.isalpha():
        return c.lower()

def unShiftWord(word):
    p=""
    lst=[]
    for i in range(len(word)):
        if isShifted(word[i]):
            p=p+unShiftLetter(word[i])
            if i>len(word)//2:
                lst.append(i-len(word))
            else:
                lst.append(i)
        else:
            p=p+word[i]
    return p,str(tuple(lst))

def unLeetWord(word):
    lst=[]
    if "0" in word:
        word=word.replace("0","o")
        lst.append(1)
    if "1" in word:
        word=word.replace("1","i")
        lst.append(12)
    elif "!" in word:
        word=word.replace("!","i")
        lst.append(13)
    if "@" in word:
        word=word.replace("@","a")
        lst.append(2)
    elif "4" in word:
        word=word.replace("4","a")
        lst.append(3)
    if "3" in word:
        word=word.replace("3","e")
        lst.append(6)
    if "$" in word:
        word=word.replace("$","s")
        lst.append(4)
    elif "5" in word:
        word=word.replace("5","s")
        lst.append(5)
    if "2" in word:
        word=word.replace("2","z")
        lst.append(11)
    if "%" in word:
        word=word.replace("%","x")
        lst.append(14)
    if "7" in word:
        word=word.replace("7","t")
        lst.append(10)
    elif "+" in word:
        word=word.replace("+","t")
        lst.append(9)
    if "9" in word:
        word=word.replace("9","g")
        lst.append(8)
    elif "6" in word:
        word=word.replace("6","g")
        lst.append(7)
    return word,str(tuple(sorted(lst)))



def main(username,password,path):
    r=rank(password,path)
    y=str(uuid.uuid1())
    f=open(path+"/out/"+str(y)+".txt","w")
    f.write(username+","+str(math.log2(r))+","+str(time.asctime())+"\n")
    f.close()


